import React, { Component } from 'react';
import Todos from './components/Todos';

class App extends Component {

  state= {
    todos:[
      {
        id: 1,
        title:'Take out the trash',
        completed: false
      },
      {
        id: 2,
        title:'Dinner with boss',
        completed: true
      },
      {
        id: 3,
        title:'Colloquio',
        completed: false
      }
    ]
  }

  render(){
    return (
      <div className="App">
        <Todos todo={this.state.todos} />
      </div>
    );
  }
}

export default App;
